A fun BEFORE / AFTER clip of a new single I Produced for @becca_bowen_ ! I got this song from the incredible @rebeccalynnhoward who sent me a “work tape” which is basically a voice memo on her phone. I pitched it down a couple keys to fit Becca’s power range and began building the track. So much fun! @allcountrynews He’s calling Becca, “the next big thing” in country music!

